var toStringFromShiftJIS = function(data) {
	var a = data.map(function(element, index, array) {
		var str = element.toString(16).toUpperCase();
		if (str.length == 1) {
			return "%0" + str;
		}
		return "%" + str;
	});
	return UnescapeBIG5(a.join(""));
};

var UnescapeBIG5=function(str){
	return str.replace(new RegExp("(%A[1-9A-F]|%[B-E][0-9A-F]|%F[0-9])(%[4-6][0-9A-F]|%7[0-9A-E]|%A[1-9A-F]|%[B-E][0-9A-F]|%F[0-9A-E])|%[0-7][0-9A-F]", "ig"),function(s){
		var c=parseInt(s.substring(1),16);
		return c<128?String.fromCharCode(c):CBT13461.charAt((c-161)*191+parseInt(s.substring(4),16)-64)
	});
};

